import styled from "styled-components";
import logo from '../../Assets/logo-v2.png'



function Header({ onSearch }) {
    return (
        <HeaderContainer>       
             <LogoImg
                src={logo}
                alt='logo'
            />         
        </HeaderContainer>
    )
}



const HeaderContainer = styled.header`
    display: flex;
    flex-direction: column; 
    align-items: center;
   
    
`;





export default Header
